import "./App.css";

// console.log(add, 'add')
function App() {
  const Button = require("@ifss/ui");
  console.log(Button, 'ButtonButtonButtonButton')
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="header">
          Web
          <div className="Turborepo">Turborepo Example</div>
        </h1>
        <div>
        <h1>person: <Button /> </h1>
        </div>
      </header>
    </div>
  );
}

export default App;
